[temperature_fan raspberry_pi]
# pi fan - In FAN2
sensor_type: temperature_host
pin: PA2
hardware_pwm: False
shutdown_speed: 0.0
max_power: 1.00
kick_start_time: 0.1
target_temp: 40.0
min_temp: 10
max_temp: 65
max_speed: 1.0
min_speed: 0.5
off_below: 0.5
control: pid
pid_Kp: 2.0     ;40
pid_Ki: 5.0     ;0.2
pid_Kd: 0.5     ;0.1
pid_deriv_time: 2.0


[temperature_fan fly_super8]
